import logo from '../Assets/img/logo.png';

function Navbar() {
  return (

<nav className="navbar">
  <div className="nav-left">
    <a href="#" className="navtext">LUCAS</a>
    <a href="#" className="navtext">RESULTADOS</a>
    <a href="#" className="navtext">PREGUNTAS FRECUENTES</a>
  </div>
  <div className="nav-center">
    <img src={logo} className="imglogo" alt="logo" />
  </div>

  <div className="nav-right">
      <span className="text1">Necesito ayuda</span>
  </div>
</nav>

  );
}
export default Navbar;
